import React from "react";
import Card from './Cards';
import Sdata from './Sdata';

function Amazon(){
    return(
        <Card
        key={Sdata[1].id}
        imgsrc={Sdata[1].imgsrc}
        title={Sdata[1].title}
        mname={Sdata[1].mname}
        link={Sdata[1].link}
        />

    );
}
